Mollys Life - Molly Cavalli, Cammie Fox -  Hot and candy 

June 27 2011

Hey guys, Molly here. Cammie came over to hang out. After I told her I ordered a cotton candy machine off the net, she had the great idea of dressing up like some funky 70s girls with colorful afros. We picked the same colors as the flavors of cotton candy I had ordered. We just pigged out on that stuff and then munched on each other for a while.
